# This file contains common pin mappings for the BIGTREETECH SKR mini
# E3 v2.0. To use this config, the firmware should be compiled for the
# STM32F103 with a "28KiB bootloader" and USB communication. Also,
# select "Enable extra low-level configuration options" and configure
# "GPIO pins to set at micro-controller startup" to "!PA14".
 
# The "make flash" command does not work on the SKR mini E3. Instead,
# after running "make", copy the generated "out/klipper.bin" file to a
# file named "firmware.bin" on an SD card and then restart the SKR
# mini E3 with that SD card.
 
# See docs/Config_Reference.md for a description of parameters.
[include macros.cfg]

[include adxl345.cfg]

[include eddy.cfg]

[include KAMP_Settings.cfg]

[include shell_command.cfg]

[include Servo.cfg]

[exclude_object]

[include knomi.cfg]

[force_move]
enable_force_move: True

[stepper_x]
step_pin: PB13
dir_pin: !PB12
enable_pin: !PB14
microsteps: 16
rotation_distance: 40
endstop_pin: tmc2209_stepper_x:virtual_endstop
position_endstop: 0
position_min: 0
position_max: 235
homing_speed: 50
homing_retract_dist: 0

[tmc2209 stepper_x]
uart_pin: PC11
tx_pin: PC10
diag_pin: ^PC0
uart_address: 0
run_current: 1.2
stealthchop_threshold: 0
driver_SGTHRS: 123

[gcode_macro _HOME_X]
gcode:
    # Always use consistent run_current on A/B steppers during sensorless homing
    {% set RUN_CURRENT_X = printer.configfile.settings['tmc2209 stepper_x'].run_current|float %}
    {% set RUN_CURRENT_Y = printer.configfile.settings['tmc2209 stepper_y'].run_current|float %}
    {% set HOME_CURRENT = 0.6 %}
    SET_TMC_CURRENT STEPPER=stepper_x CURRENT={HOME_CURRENT}
    SET_TMC_CURRENT STEPPER=stepper_y CURRENT={HOME_CURRENT}

    # Home
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=True
    FORCE_MOVE STEPPER=stepper_z DISTANCE=1 VELOCITY=2
    G28.1 X
    # Move away
    G91
    G1 X10 F1200
    
    # Wait just a secondâ€¦ (give StallGuard registers time to clear)
    G4 P1000
    G90
    # Set current during print
    SET_TMC_CURRENT STEPPER=stepper_x CURRENT={RUN_CURRENT_X}
    SET_TMC_CURRENT STEPPER=stepper_y CURRENT={RUN_CURRENT_Y}

[homing_override]
gcode:
    {% if not 'Z' in params and not 'Y' in params and 'X' in params %}
    G4 P500
    _HOME_X
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=False
    {% elif not 'Z' in params and not 'X' in params and 'Y' in params %}
    G4 P500
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=True
    G28.1 Y
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=False
    {% elif not 'Z' in params and 'X' in params and 'Y' in params %}
    G4 P500
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=True
    _HOME_X
    G28.1 Y
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=False
    {% elif 'Z' in params and not 'X' in params and not 'Y' in params %}
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=True
    G90
    G0 X117.5 Y117.5 P12000
    G28.1 Z
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=False
    {% else %}
    G4 P500
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=True
    _HOME_X
    G28.1 Y
    G90
    G0 X117.5 Y117.5 P12000
    G28.1 Z
    SET_GCODE_VARIABLE MACRO=_KNOMI_STATUS VARIABLE=homing VALUE=False
    {% endif %}
axes: xyz

[stepper_y]
step_pin: PB10
dir_pin: !PB2
enable_pin: !PB11
microsteps: 16
rotation_distance: 40
endstop_pin: ^PC1
position_endstop: 247
position_min: 0
position_max: 247
homing_speed: 50

[tmc2209 stepper_y]
uart_pin: PC11
tx_pin: PC10
uart_address: 2
run_current: 1.2
stealthchop_threshold: 0

[stepper_z]
step_pin: PB0
dir_pin: PC5
enable_pin: !PB1
microsteps: 64
rotation_distance: 0.5
endstop_pin: probe:z_virtual_endstop
position_max: 240
position_min: -4
homing_speed: 3.5

[tmc2209 stepper_z]
uart_pin: PC11
tx_pin: PC10
uart_address: 1
run_current: 0.580
stealthchop_threshold: 999999

[extruder]
step_pin: !PB3
dir_pin: PB4
enable_pin: !PD1
microsteps: 16
rotation_distance: 64.16
nozzle_diameter: 0.4
gear_ratio: 19:2
filament_diameter: 1.750
heater_pin: PC8
sensor_type: Generic 3950
max_power: 1
sensor_pin: PA0
smooth_time: 2.5
max_extrude_cross_section: 100
max_extrude_only_distance: 120
min_extrude_temp: 0
#control: pid
#pid_Kp: 21.527
#pid_Ki: 1.063
#pid_Kd: 108.982
min_temp: -150 ;0
max_temp: 500 ;300
 
[tmc2209 extruder]
uart_pin: PC11
tx_pin: PC10
uart_address: 3
run_current: 0.625
stealthchop_threshold: 999999

[servo a_servo]
pin: PA1
maximum_servo_angle: 360

[heater_bed]
heater_pin: PC9
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PC4
#control: pid
#pid_Kp: 54.027
#pid_Ki: 0.770
#pid_Kd: 704.938
min_temp: 0 ;0
max_temp: 130 ;130
 
[fan_generic bed_fan]
pin: PC7
max_power: 1

#[controller_fan mainboard_cooling] 
#pin: PC7 
#max_power: 1.0
#shutdown_speed: 0.0
#cycle_time: 0.010
#hardware_pwm: false
#kick_start_time: 0.100

[fan]
pin: PC6
max_power: 1
cycle_time: 0.097
 
[mcu]
serial: /dev/ttyAMA0
restart_method: command
 
[printer]
kinematics: corexy
max_velocity: 500
max_accel: 25000
#max_accel_to_decel: 3000
max_z_velocity: 3
max_z_accel: 50

[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: 0
max_temp: 85

[static_digital_output usb_pullup_enable]
pins: !PA14
 
[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PB5,  EXP1_3=PA9,   EXP1_5=PA10, EXP1_7=PB8, EXP1_9=<GND>,
    EXP1_2=PA15, EXP1_4=<RST>, EXP1_6=PB9,  EXP1_8=PD6, EXP1_10=<5V>
 
[gcode_arcs]

[bed_screws]
screw1: 30, 0
screw1_name: FRONT LEFT
screw2: 30, 170
screw2_name: BACK LEFT
screw3: 200, 170
screw3_name: BACK RIGHT
screw4: 200, 0
screw4_name: FRONT RIGHT
horizontal_move_z: 5
speed: 100

[screws_tilt_adjust]
screw1: 30, 0
screw1_name: FRONT LEFT
screw2: 30, 170
screw2_name: BACK LEFT
screw3: 200, 170
screw3_name: BACK RIGHT
screw4: 200, 0
screw4_name: FRONT RIGHT
horizontal_move_z: 7
speed: 100
screw_thread: CW-M4

[virtual_sdcard]
path: ~/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[pause_resume]
#recover_velocity: 50.
#   When capture/restore is enabled, the speed at which to return to
#   the captured position (in mm/s). Default is 50.0 mm/s.

[display_status]

[respond]

[skew_correction]

